pragma solidity 0.8.1;

import "@openzeppelin/contracts@4.4.2/access/Ownable.sol";
import "@openzeppelin/contracts@4.4.2/token/ERC20/IERC20.sol";

interface IMintStorage {
    function preLoadURIs(uint[] memory ids, string[] memory uris) external;
    function mintNextNftToAddress(address to) external;
}

contract FoundingNFTSale is Ownable {
    address public storageContract;

    uint saleStart = 1893484800; //set to the year 2030 initially, needs to be updated once date is finalized 
    uint saleEnd;

    struct Update {
        uint price;
        uint time;
        bool saleIsLive;
    }
    Update public lastUpdate = Update(10000, block.timestamp, false);

    modifier requiresUpdate() {
        updateState();
        _;
    }

    modifier requiresConsistentState() {
        require(saleStart <= saleEnd, "saleStart is later than saleEnd");
        _;
    }

    function updateState() internal requiresConsistentState {
        if (block.timestamp >= saleStart && block.timestamp <= saleEnd) {
            lastUpdate.saleIsLive = true;
        } else {
            lastUpdate.saleIsLive = false;
        }
    }

    function setStorageContractAddress(address storageAddress) public onlyOwner {
        storageContract = storageAddress;
    }

    function mintNextNftToAddress(address to) internal {
        IMintStorage(storageContract).mintNextNftToAddress(to);
    }

    function preLoadURIs(uint[] memory ids, string[] memory uris) public onlyOwner {
        IMintStorage(storageContract).preLoadURIs(ids, uris);
    }

    function setSaleStart(uint unixTime) public onlyOwner {
        saleStart = unixTime;
    }

    function setSaleEnd(uint unixTime) public onlyOwner {
        saleEnd = unixTime;
    }

    function buyNFT() public payable {

    }
}

